interface AggregatorV3Interface {
    function decimals() external view returns (uint8);

    function description() external view returns (string memory);

    function version() external view returns (uint256);

    // getRoundData and latestRoundData should both raise "No data present"
    // if they do not have data to report, instead of returning unset values
    // which could be misinterpreted as actual reported values.
    function getRoundData(uint80 _roundId)
        external
        view
        returns (
            uint80 roundId,
            int256 answer,
            uint256 startedAt,
            uint256 updatedAt,
            uint80 answeredInRound
        );

    function latestRoundData()
        external
        view
        returns (
            uint80 roundId,
            int256 answer,
            uint256 startedAt,
            uint256 updatedAt,
            uint80 answeredInRound
        );
}

contract FundingMXC is Context, Ownable {
    using SafeMath for uint256;
    using Address for address;

    mapping(address => uint256) public _balancesUSDT;
    mapping(address => uint256) public _balancesETH;

    uint256 public _totalFunding;
    uint256 public _deadline = 5 days;
    uint256 public _startTime;
    uint256 public _maxFunding = 30000e6;
    AggregatorV3Interface internal priceFeed;
    IERC20 public USDTaddress;

    constructor() public {
        _startTime = block.timestamp;
        uint256 id;
        assembly {
            id := chainid()
        }
        priceFeed = AggregatorV3Interface(
            id == 4
                ? 0x8A753747A1Fa494EC906cE90E9f37563A8AF630e
                : 0x5f4eC3Df9cbd43714FE2740f5E3616155c5b8419
        );
        USDTaddress = IERC20(0xc272FAc323B8b04fD9a003bA30179B1b49A48D9e);
    }

    modifier endFunding() {
        // require(block.timestamp > _startTime.add(_deadline));
        _;
    }

    function getLatestPrice() public view returns (int256) {
        (, int256 price, , , ) = priceFeed.latestRoundData();
        return price;
    }

    function set(address u) external {
        USDTaddress = IERC20(u);
    }

    function fundingUSDT(uint256 amount) external {
        require(amount > 0);
        USDTaddress.transferFrom(_msgSender(), address(this), amount);
        _balancesUSDT[_msgSender()] = _balancesUSDT[_msgSender()].add(amount);
        _totalFunding = _totalFunding.add(amount);
    }

    function fundingETH() public payable {
        uint256 amount = msg.value;
        _balancesETH[_msgSender()] = _balancesETH[_msgSender()].add(amount);
        uint256 etherToUsdt = amount
            .mul(uint256(getLatestPrice()).div(100))
            .div(10**18);
        _totalFunding = _totalFunding.add(etherToUsdt);
    }

    function withdraw() public endFunding onlyOwner {
        // require(_totalFunding >= _maxFunding);
        uint256 USDTamount = USDTaddress.balanceOf(address(this));
        if (USDTamount > 0) {
            USDTaddress.transfer(owner(), USDTamount);
        }
        uint256 ETHamount = address(this).balance;
        if (ETHamount > 0) {
            payable(owner()).transfer(ETHamount);
        }
    }

    function refund() public endFunding {
        // require(_totalFunding < _maxFunding);
        require(
            _balancesETH[_msgSender()] > 0 || _balancesUSDT[_msgSender()] > 0
        );
        if (_balancesUSDT[_msgSender()] > 0) {
            USDTaddress.transfer(_msgSender(), _balancesUSDT[_msgSender()]);
        }
        if (_balancesETH[_msgSender()] > 0) {
            payable(_msgSender()).transfer(_balancesETH[_msgSender()]);
        }
    }

    receive() external payable {
        fundingETH();
    }
}

